The highlight of the MICHELIN Guide Budapest 2021 is that two restaurants have been awarded 1 Star with our highest honor: Essência and Salt, both of which are new to the Guide’s selection.

@essenciarestaurantbudapest is run by Tiago & Éva. Chef Tiago is Portuguese, and his wife Éva is Hungarian. At this stylish and warmly run restaurant, the menus are a joyful celebration of both their nationalities. 

@salt_budapest is the brainchild of chef-owner Szilárd Tóth. The cleverly constructed and creative set menu uses plenty of techniques, like fermenting and pickling.

📍 Budapest, Hungary
